import React, { useState } from 'react';
import './Sidebar.css';

const Sidebar = ({ activeTab, countdown, refreshCount, totalCandidates, onTabChange, loading, error, lastRefresh, onRefresh }) => {
  const [isCollapsed, setIsCollapsed] = useState(false);

  const toggleSidebar = () => {
    setIsCollapsed(!isCollapsed);
  };

  return (
    <div className={`sidebar ${isCollapsed ? 'collapsed' : ''}`}>
      <div className="sidebar-header">
        <h3>‚öôÔ∏è Configuration</h3>
        <button 
          className="sidebar-toggle-button"
          onClick={toggleSidebar}
          title={isCollapsed ? 'Expand Sidebar' : 'Collapse Sidebar'}
        >
          {isCollapsed ? '‚ñ∂Ô∏è' : '‚óÄÔ∏è'}
        </button>
      </div>

      <div className="sidebar-content">
        <div className="sidebar-section">
          <h4>üé• Projector Mode</h4>
          <div className="status-indicator connected">
            ‚úÖ Enabled
          </div>
        </div>

        <div className="sidebar-section">
          <h4>üîó Google Sheets Connection</h4>
          {loading ? (
            <div className="status-indicator loading">
              ‚è≥ Loading data...
            </div>
          ) : error ? (
            <div className="status-indicator disconnected">
              ‚ùå Connection Error
              <div style={{fontSize: '0.8em', marginTop: '5px'}}>
                {error.length > 50 ? error.substring(0, 50) + '...' : error}
              </div>
            </div>
          ) : (
            <div className="status-indicator connected">
              ‚úÖ Connected to Google Sheets
            </div>
          )}
          <p>üìä <strong>Total Candidates:</strong> {totalCandidates}</p>
          <p>üèÜ <strong>Top 10 by Value:</strong> 10 candidates</p>
          <p>üìä <strong>Remaining by Value:</strong> {Math.max(0, totalCandidates - 10)} candidates</p>
          {lastRefresh && (
            <p>üïí <strong>Last Updated:</strong> {new Date(lastRefresh).toLocaleTimeString()}</p>
          )}
        </div>

        <div className="sidebar-section">
          <h4>üîÑ Tab Switching Status</h4>
          <p><strong>Current tab:</strong> {activeTab === 0 ? 'üèÜ Top 10' : 'üìä Remaining'}</p>

          <div className="countdown-timer">
            ‚è±Ô∏è Next switch in: {countdown} seconds
          </div>

          <div className="tab-buttons">
            <button 
              className={`tab-button ${activeTab === 0 ? 'active' : ''}`}
              onClick={() => onTabChange(0)}
            >
              üèÜ Show Top 10
            </button>
            <button 
              className={`tab-button ${activeTab === 1 ? 'active' : ''}`}
              onClick={() => onTabChange(1)}
            >
              üìä Show Remaining
            </button>
          </div>
        </div>

        <div className="sidebar-section">
          <h4>üìä Refresh Status</h4>
          <p>üîÑ <strong>Refresh count:</strong> {refreshCount}</p>
          <p>‚è∞ <strong>Auto-refresh:</strong> Every 1 minute</p>
          <button className="refresh-button" onClick={onRefresh} disabled={loading}>
            {loading ? '‚è≥ Loading...' : 'üîÑ Refresh Data'}
          </button>
        </div>

        <div className="sidebar-section">
          <h4>üîç Debug Info</h4>
          <p>Active tab: {activeTab}</p>
          <p>Countdown: {countdown}s</p>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
